import React from 'react';
import App from '../components/App';

class Index extends React.Component {
    render() {
        return (
            <div>
                <App></App>
                <style>
                    {`
                        body {
                            width: 100vw;
                            height: 100%;
                            background-color: black;
                        }
                    `}
                </style>
            </div>
        )
    }
}

export default Index;
